                <h1 className="text-6xl text-green-100 font-bold cursive leading-none lg:leading-snug">Hello.</h1>
                <h2 className="text-6xl text-green-100 font-bold cursive leading-none lg:leading-snug home-name1">I am happy to see you here.</h2>
            </section>
        </main>    
    )
}
